Given an array that contains N elements what is the 
expected running time of method find? Choose the 
most restrictive correct answer. 



/* pre: data != null, elements of data are 
sorted in ascending order. 
*/ 
public static int find(int tgt, int[] data){ 
  int en = data.length - 1;   
  return help(0, en, tgt, data); 
} 

private static int help(int st, int en,  
int tgt, int[] data){   
  int result = -1; 
  int md, val; 
  if( st <= en ){ 
      md = (st + en) / 2; 
      val = data[ md ]; 
      if( val == tgt ) 
        result = md; 
      else if( tgt < val ) 
        result =  help(st, md - 1, tgt, data);
      else 
        result = help(md + 1, en, tgt, data); 
  } 
  return result; 
} 

public static void first(){ 
  int[] data = {0, 5, 19, 100}; 
  System.out.print( find(5, data) ); 
}

